window.bookSummaryJSON = "<p>Wins and losses, there is no time to celebrate or mourn. The Pantheon in the chaos has once again risen to power, some trying to take power from one another, others supporting the people of Emerilia. The people of Emerilia are finally getting ahead of the war against the Event of Myths and Legends, of those who were spawned in and those who entered through portals. The Pantheon once again displays its might. </p> <p>Win or lose, there are no other paths open to the people of Emerilia.</p>"; 
